import React from "react";
import { View, Text, StyleSheet } from "react-native";


export default function PostsScreen() {
  return (
    <View style={styles.container}>
      <Text>Публикации</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    textAlign: "center",
    flex: 1,
    backgroundColor: "#fff",
  },
  title:{
    color: "#212121",
  }
});
